import React, { useState, useEffect } from 'react';

const Player = ({ playlistId, name, color }) => {
  const [playlist, setPlaylist] = useState([]);
  const [currentTrack, setCurrentTrack] = useState(0);
  const [isPlaying, setIsPlaying] = useState(false);
  const [progress, setProgress] = useState(0);
  const [duration, setDuration] = useState(0);

  const YOUTUBE_API_KEY = 'AIzaSyA8NmqtBGCc12OcuVhZUDNhzTYbagkoHTk';

  useEffect(() => {
    const playlistId = 'YOUR_YOUTUBE_PLAYLIST_ID';
    const apiKey = 'YOUR_YOUTUBE_API_KEY';

    fetch(
      `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&maxResults=25&playlistId=${playlistId}&key=${apiKey}`
    )
      .then((response) => response.json())
      .then((data) => {
        setPlaylist(data.items);
      });
  }, []);

  useEffect(() => {
    const audioElement = document.getElementById('audio-element');
    if (isPlaying) {
      audioElement.play();
    } else {
      audioElement.pause();
    }
  }, [isPlaying]);

  useEffect(() => {
    const audioElement = document.getElementById('audio-element');
    audioElement.currentTime = progress;
  }, [progress]);

  useEffect(() => {
    const audioElement = document.getElementById('audio-element');
    audioElement.addEventListener('loadedmetadata', () => {
      setDuration(audioElement.duration);
    });
    audioElement.addEventListener('timeupdate', () => {
      setProgress(audioElement.currentTime);
    });
    audioElement.addEventListener('ended', () => {
      if (currentTrack < playlist.length - 1) {
        setCurrentTrack(currentTrack + 1);
      } else {
        setCurrentTrack(0);
      }
    });
    return () => {
      audioElement.removeEventListener('loadedmetadata', () => {});
      audioElement.removeEventListener('timeupdate', () => {});
      audioElement.removeEventListener('ended', () => {});
    };
  }, [currentTrack, playlist]);

  const handlePlayPause = () => {
    setIsPlaying(!isPlaying);
  };

  const handlePrev = () => {
    if (currentTrack > 0) {
      setCurrentTrack(currentTrack - 1);
    } else {
      setCurrentTrack(playlist.length - 1);
    }
  };

  const handleNext = () => {
    if (currentTrack < playlist.length - 1) {
      setCurrentTrack(currentTrack + 1);
    } else {
      setCurrentTrack(0);
    }
  };

  const handleProgressChange = (event) => {
    setProgress(parseInt(event.target.value));
  };

  return (
    <div style={{...styles.container, backgroundColor: color}}>
      <div style={styles.header}>
        <h1 style={styles.title}>BREWBELLY.FM</h1>
        <h2 style={styles.subtitle}>{name}</h2>
      </div>
      <div className="music-player" style={styles.player}>
        <div style={styles.songInfo}>
          <h2 style={styles.songTitle}>{currentTrackData.title}</h2>
          <h3 style={styles.songArtist}>{currentTrackData.artist}</h3>
        </div>
        <audio id="audio-element" src={playlist[currentTrack]?.snippet?.resourceId?.videoId} onEnded={handleNextTrack} />
        <div style={styles.songCount}></div>
        <div style={styles.controls}>
          <button onClick={handlePrevTrack} style={styles.fas} id="prev-btn">back</button>
          <button onClick={handlePlayPause} style={styles.fas} id="play-btn">{isPlaying ? 'pause' : 'play'}</button>
          <button onClick={handleNextTrack} style={styles.fas} id="next-btn">fwrd</button>
        </div>
        <div style={styles.timelineContainer}>
          <input
            type="range"
            className="progress=bar"
            value={trackProgress}
            max="100"
            onChange={handleScrub}
          />
          <div style={styles.timeInfo}>
            <span>{formatTime(progress)}</span>
            <span>{formatTime(duration)}</span>
          </div>
        </div>
      </div>
    </div>
  )
}

